import React from "react";
import { Navbar, Container, Nav, NavDropdown } from "react-bootstrap";
import "./App.css";

import ReactDOM from "react-dom";
import "./index.css";

ReactDOM.render(
  <React.StrictMode>
    <h1 style={{ fontFamily: "Roboto, sans-serif" }}>Hello, SheCodes!</h1>
  </React.StrictMode>,
  document.getElementById("root")
);

const Header = () => {
  return (
    <header>
      <div className="video-section">
        {/* Background video */}
        <video
          className="background-video"
          src="https://www.maisonmirabeau.com/main/wp-content/uploads/2023/04/maison-mirabeau-header-2023.mp4"
          autoPlay
          loop
          muted
        />

        {/* Overlay image at the bottom right corner */}
        <img
          className="overlay-image"
          src="https://www.maisonmirabeau.com/main/wp-content/uploads/2023/09/b-corp-logo-en.svg"
          alt="Overlay Image"
        />
      </div>

      {/* Navigation bar */}
      <Navbar bg="light" expand="lg" variant="light" fixed="top">
        <Container>
          {/* Logo */}
          <Navbar.Brand href="#home">
            <img src="https://s3.amazonaws.com/shecodesio-production/uploads/files/000/126/912/original/mirabeau-logo.png?1716116679"></img>
          </Navbar.Brand>

          {/* Links */}
          <Nav className="ml-auto">
            {/* Magnifier glass icon */}
            <Nav.Link href="#search">
              <i className="fas fa-search"></i>
            </Nav.Link>

            {/* List of 4 links */}
            <NavDropdown title="Links" id="links-dropdown">
              <NavDropdown.Item href="#link1">Link 1</NavDropdown.Item>
              <NavDropdown.Item href="#link2">Link 2</NavDropdown.Item>
              <NavDropdown.Item href="#link3">Link 3</NavDropdown.Item>
              <NavDropdown.Item href="#link4">Link 4</NavDropdown.Item>
            </NavDropdown>
          </Nav>
        </Container>
      </Navbar>
    </header>
  );
};

export default Header;
